import React from 'react';
import styled from 'styled-components';

const Exercise = () => {
  return (
    <ExerciseWrapper>
      <h1>Welcome to the Exercise Page</h1>
      <p>Get ready for your fitness journey!</p>
    </ExerciseWrapper>
  );
};

export default Exercise;

/* --- STYLES --- */
const ExerciseWrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  height: 100vh;
  background: radial-gradient(125% 125% at 50% 10%,rgb(246, 59, 190) 40%, #000 100%);
  color: white;
  text-align: center;

  h1 {
    font-size: 36px;
    margin-bottom: 20px;
  }

  p {
    font-size: 18px;
  }
`;
